  [],\n\t\"revision_timestamp\": \"2016-07-27T23:02:22.399762\",\n\t\"name\": \"arctic-and-aleutian-terns-amchitka-island-alaska\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Baird (1980) has recently reported on the
  ecology of Arctic terns (Sterna paradisaea) and Aleutian terns (Sterna aleutica)
  from 4 areas of mainland Alaska. However, prior to 1964 only notes on the occurrence
  of terns in the Aleutian Islands were available (i.e. Bent 1921, Murie 1959, Kenyon
  1961). In 1968 the Aleutian tern was first discovered nesting in the western Aleutians,
  on Amchitka Island (Williamson 1968). In the next 5 years, 1968-1973, census and
  ecological study of terns on Amchitka was conducted under support of the Atomic
  Energy Commission. Since that time only reports of sightings of terns on Amchitka
  have been made. It was attempted in 1980 to determine the status of the tern colonies
  studied by the A.E.C. Also, since Arctic terns make extremely long migrations and
  the migratory habits of the Aleutian tern are not well known (Bent 1921) all terns
  encountered were banded.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
